b) Không nợ học phí;

c) Không vi phạm các Quy chế, Quy định của Nhà trường; không bị kỷ

luật trong suốt quá trình học;




d) Điều kiện về điểm trung bình và xếp loại rèn luyện toàn khóa học được

quy định tại Khoản 2 Điều này.

2. Tiêu chuẩn và danh hiệu khen thưởng

a) SV tốt nghiệp có điểm trung bình khóa học cao nhất toàn trường và có

Xếp loại rèn luyện toàn khóa học từ Khá trở lên được công nhận và

khen thưởng với danh hiệu **Thủ khoa Trường** ;

b) SV tốt nghiệp có điểm trung bình khóa học cao nhất ngành học và có

Xếp loại rèn luyện toàn khóa học từ Khá trở lên được công nhận và

khen thưởng với danh hiệu **Thủ khoa Ngành** . Ngành đã có SV đạt danh

hiệu Thủ Khoa Trường sẽ không xét Thủ khoa Ngành;

c) SV tốt nghiệp có điểm trung bình khóa học từ 9.0 trở lên và có Xếp

loại rèn luyện toàn khóa học từ Khá trở lên sẽ được khen thưởng thành

tích tốt nghiệp loại Xuất sắc;

d) SV tốt nghiệp có điểm trung bình khóa học từ 8.0 trở lên và có Xếp

loại rèn luyện toàn khóa học từ Khá trở lên sẽ được khen thưởng thành

tích tốt nghiệp loại Giỏi;
